import React, {Component} from 'react';
import './Questions.css'
// import AudioPlayer from 'react-custom-audio-player';
// import 'react-custom-audio-player/src/style.scss'



class Questions extends Component {
    render() {
        const data = (this.props.data);
        const {true2} = this.props;
        let stars = [];
        for (let i = 0; i <= data.name.length; i++) {
            stars.push('*')
        }

        return (
            <div className={'random-bird jumbotron rounded'}>
                <img className={'bird-image'} src={'../../images/bird.06a46938.jpg'}
                     alt=""/>
                <div>
                    <ul className={'list-group list-group-flush'}>
                        <li className="list-group-item">
                            {true2 ? true2.name : stars.map((item, index) =>
                                    <h3 key={index}>{item}</h3>
                                )}
                        </li>

                        <li className="list-group-item">
                            {/*<AudioPlayer*/}
                            {/*    src={data.audio}*/}
                            {/*    autoPlay={false}*/}
                            {/*/>*/}
                        </li>
                    </ul>
                </div>

            </div>
        );
    }
}

export default Questions;
